      SELECT DISTINCT + COUNT ( * ), - COUNT ( ALL - 96 ) AS col1 FROM tab2 WHERE NOT + + col1 + + col0 * ( ( - col0 ) ) BETWEEN + col2 AND - col2 / - col2 * - col1;
  - name: tab2

outputs:
  - name: q9351.out
    data: |
      3	-3
